import React from 'react'
import "./style.css"
import 'bootstrap/dist/css/bootstrap.min.css'

class Head extends React.Component {
	render() {
		return (
	    	<div>
                <div className="center APPbackground"><div className="APPtexthead">
                    <b>NUMERIC</b>
                    </div><br/><div>ระเบิดเวลา ฮ้าาาาาา เริ่มเดินมาตั้งแต่น้องพบเขา
                    <br/>เจ้าถ่ายโอนในความเป็นเรา ยกให้เขาทีละน้อย อ้ายวิ่งไขว่คว้าตามใจเจ้าคืน
                    <br/>น้องกะบืนหนีใส่เกียร์ถอย ได้แต่มองฮักที่หลุดลอย รอถึงวันเลิกรา</div>
                </div>
                <div className="homemenutop"/>
                </div>
	  	);
	}
}

export default Head;
